/* Style for the body element */
body {
    background-image: url('https://files.clearlydev.com/site-assets/2023/03/Screenshot_48.png'); /* Replace 'your-image-url.jpg' with your actual image URL */
    background-size: cover; /* Cover the entire viewport */
    background-position: center; /* Center the background image */
    background-repeat: no-repeat; /* Do not repeat the image */
    background-attachment: fixed; /* Fix the background image during scrolling */
    height: 100vh; /* Make sure the body covers the full viewport height */
    margin: 0; /* Remove default margin */
}
